module.exports = "<h6 class=\"_backlink\"><a routerLink=''>Back to home</a></h6>\n<h2 class=\"main_title\">How Well Does Our Value-Based Model Perform <br> in the 2016 Presidential Election?</h2>\n\n<div class=\"article\">\n  <p>\n  We created a predictive model that calculates the proportion of votes for Donald Trump in the 2016 election based on responses\n  to a select number of value-based questions from the American Values Survey, administered by the\n  <a href = \"https://www.prri.org/data-vault/\" target=\"_blank\">Public Religion Research Institute (PRRI)</a> in 2017.\n  </p>\n\n  <p>This map below shows our model calculations relative to the actual 2016 election percentages by U.S. state: </p>\n</div>\n\n<div id=\"tooltip\">\n  <span id=\"value\"></span>\n</div>\n\n<div class=\"container\">\n  <div class = \"graphic\">\n  </div>\n</div>\n\n<div class=\"article\">\n  <p>You can read about the methodology, analysis, and data manipulation behind the regression model in more detail <a href=\"http://rpubs.com/zachalexander/fnl-proj\" target=\"_blank\">\n    on my RPubs account.</a>\n  </p>\n\n  <p>\n    To increase the performance of our model, we had to remove residuals that were outliers. Therefore, you'll notice that a few states, including\n    California, Maryland, Montana, Oklahoma, North Dakota, Hawaii, and Alaska will not have model calculations. We'll look to hone in even further on the diagnostics\n    in an attempt to alleviate the high residual values in these states' predictions. However, in the meantime, we'll have to leave these states out of our analysis.\n  </p>\n  <br>\n  <h4>Questions from the survey that showed high predictive capacity</h4>\n  <hr>\n  <p>\n      Surveyors asked a series of questions related to individuals' perceptions of various values. Conveniently, the U.S. state of residence was also collected\n      for each respondent. Therefore, we were eventually able to map responses on a state-wide level, and to build our model based on these factors. Through\n      <a href=\"https://en.wikipedia.org/wiki/Stepwise_regression\" target=\"_blank\">stepwise regression</a> using backward elimination, we were able to create\n      a pretty reliable model, with an R-square value of around 0.87 -- meaning that about 87% of the variability in the proportion of voters that voted for\n      Donald Trump in 2016 by state, can be attributed to the variables included in our model.\n  </p>\n  <p>The following questions and their corresponding variables were included in our value-based model: </p>\n  <h5>Do you strongly favor, favor, oppose, or strongly oppose...</h5>\n  <div class=\"container\">\n    <li>Allowing\tgay\tand\tlesbian\tcouples\tto\tmarry\tlegally?</li>\n    <li>Allowing\ta\tsmall\tbusiness\towner\tin\tyour\tstate\tto\trefuse\tto\tprovide\tproducts or\tservices\n      to\tgay\tor\tlesbian\tpeople,\tif\tdoing\tso\tviolates\ttheir\treligious\tbeliefs?</li>\n    <li>Building a wall along the U.S. border with Mexico?</li>\n    <li>Allowing illegal immigrants brought to the U.S. as children to gain legal resident status if they join the military or go to college? </li>\n  </div>\n  <hr>\n  <h5>Do you completely agree, mostly agree, mostly disagree, or completely disagree...</h5>\n  <div class=\"container\">\n    <li>America today sets a good moral example for the world?</li>\n    <li>Professional athletes should be required to stand during the national anthem at sporting events?</li>\n  </div>\n  <hr>\n  <h5>Do you think that the following should be the highest priority, high but not highest priority, or lower priority?...</h5>\n  <div class=\"container\">\n    <li>Enacting stricter gun control laws.</li>\n    <li>Reducing health care costs.</li>\n    <li>Changing the federal income tax system to make it more fair.</li>\n  </div>\n  <hr>\n</div>\n<br>\n<div class=\"article\">\n  <h4>The Takeaway</h4>\n  <p>\n    Elections often come down to the wire and are decided by a relatively small number of votes. Candidates spend millions of dollars on\n    polling to get an idea of just how tight these margins are. We aimed to create a model that could predict polling preferences based on\n    a select number of questions pertaining to major policy points and diversity. From a statistical point of view, the final result was a\n    fairly strong model with an R-squared above <strong>0.85</strong>. This is a prime example, however, of a case where the margins in the real world are\n    much finer than in the mathematical world. The residuals of our model at times approached 0.1, which would mean a miscalculation of the\n    amount of votes Trump would get by 10%. 10% is the difference between a close race and a landslide.\n  </p>\n\n  <p>\n    While working through this process, we were able to examine values that seemed to be quite predictive of favoring votes for a particular candidate.\n    For instance, it is interesting that responses to questions related to gun control, health care, our tax system, immigration, and building a wall\n    along the southern border with Mexico all made it into our model. These topics have been at the forefront of the Trump campaign and his time in office.\n  </p>\n\n  <p>\n    When thinking about building out a similar model to predict the votes garnered by Hillary Clinton, we could re-examine these values that\n    showed to be quite predictive of votes for Trump, and see if values outside the scope of this project could be added in later on\n    that tend to hold more weight among left-leaning voters than right-leaning voters.\n  </p>\n\n  <p>\n    As mentioned at the outset, this election proved to be a very polarizing one, with people claiming at times that they would vote <strong>against</strong> a\n    particular candidate instead of voting <strong>for</strong> one. The long list of values that make up our final model prove that this is true, given that\n    there were ample opportunities for voters to project why they felt their candidate was the right choice to lead the United States.\n  </p>\n</div>\n<footer class=\"page-footer\">\n    <div class=\"container\">\n      <div class=\"row\">\n        <div class=\"col l6 s12\">\n          <h5 class=\"white-text\">Hire Me</h5>\n          <p>I'm available for freelance work and full-time employment.</p>\n        </div>\n        <div class=\"col l4 offset-l2 s12\">\n          <h5 class=\"white-text\">Find my work on</h5>\n          <ul>\n            <li><a href=\"#!\">Github</a></li>\n            <li><a href=\"#!\">Medium</a></li>\n            <li><a href=\"#!\">RPubs</a></li>\n            <li><a href=\"#!\">Twitter</a></li>\n          </ul>\n        </div>\n      </div>\n    </div>\n    <div class=\"footer-copyright\">\n      <div class=\"container\">\n       Â© 2020 Zach Alexander. All rights reserved.\n      </div>\n    </div>\n</footer>\n\n"

